  let sampleData = JSON.parse(JSON.stringify(props.watsonResponse));
  console.log(results.traits[0].children[0].percentile);

  let displayData;

  if(props.watsonResponse !== {}) {
    displayResultsHeader = "Results: "
    for (let i = 0; i < results.traits.length; i++){
      displayData = displayData + <h5>results.traits.name</h5>;
      console.log(displayData);

    }
  }

  return (
    <div>
      <h1>PersonalityBreakdown works</h1>
      <h3>{displayResultsHeader}</h3>
      <div>{displayData}</div>
    </div>
  );
}

PersonalityBreakdown.propTypes = {
  watsonResponse: PropTypes.any
};

